import { useHistory } from 'react-router-dom'

function HomeHistory() {
    let history = useHistory()
    let his

    return (
        <>
            <button onClick={() => history.push("aboutHistory", { from : "homeHistory" })} >About</button>
            <button onClick={() => history.push('contactHistory', { from : 'homeHistory' })}>Contact</button>
        </>
    )
}

function AboutHistory({ location }) {
    let history = useHistory()

    return (
        <>
            <h1>About Page</h1>
            <button onClick={() => history.goBack()}>Go Back</button>
            <p>We are directed from {location.state.from}</p>
        </>
    )
}

function ContactHistory({ location }) {
    let history = useHistory()

    return (
        <>
            <h1>Contact Page</h1>
            <button onClick={() => history.goBack()}>Go Back</button>
            <p>We are directed from {location.state.from}</p>
        </>
    )
}

export { HomeHistory, AboutHistory, ContactHistory }
